geregisseerd door Jimmy Hayward en Steve Martino
met de stemmen van radiopresentator Giel Beelen, actrice Carice van Houten, presentator Filemon Wesselink en actrice Loek Beernink.

Diep in de jungle hoort een kleine olifant plots een stem uit een klein stofdeeltje. Het blijkt een minuscule planeet te zijn waar de stad Who-Ville op gelegen is. De Who&amp;#039;s geven Horton de opdracht hun planeet te beschermen met behulp van zijn vrienden. Naar het verhaal van Dr. Seuss.

